pragma solidity ^0.5.0;
import "openzeppelin-solidity/contracts/token/ERC20/ERC20Detailed.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20Capped.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20Burnable.sol";

contract newToken is ERC20Detailed, ERC20Capped, ERC20Burnable {
uint256 public _price;
uint public _initialSupply;

 constructor(uint INITIAL_SUPPLY, string memory name, string memory symbol, uint8 decimals, uint256 cap, uint256 price) ERC20Detailed(name, symbol, decimals) ERC20Capped(cap) public {
    _initialSupply = INITIAL_SUPPLY;
    _price = price;
    _mint(msg.sender, _initialSupply);
  }

}
